import React from "react";
import { Avatar } from 'antd';
import { UserOutlined } from '@ant-design/icons';
function AppHeader() {

  return (
    <>
      <nav class="navbar bg-gradient-primary  px-4" style={{
        borderBottom:'2px solid rgb(255,255,255,0.4) '}}>
        <h3 class="navbar-brand text-white" style={{fontWeight:'bolder'}}>InventrY Mangment System</h3>
        <form class="form-inline">
         
          <Avatar src="https://pngtree.com/freepng/creative-company-logo_1197025.html" size={45} icon={<UserOutlined />} />
        </form>
      </nav>
      </>
  );
}

export default AppHeader;
